		on_talk: "if(level.player.vars.wm_fixed_long_elevator != 1, 
				speech_dialog(
								level.player,		set(level.player.animation, 'emote_talk'),
													[~Hi, I'm Frogatto.\nWhat are you doing?~],
								self, 				[~Oh, a bit of a storm through here.\nI'm cleaning up and repairing\nthe place. But, I'm be- ...\nAre you going up to Woodenhead?~],
													fire_event(self, 'talk_ask'),
								),
				[speech_dialog(
								self, 				[~Hi, Frogatto. I'm just rebuilding\nthe bridges down here, now.\nIt'll take a while.~],
								),
					if(level.player.vars.wm_collected_from_rajit = 0,
						speech_dialog(
									self,				[~Oh, by the way, thanks for taking\nthat rope up. Here's the 5 coins.~],
														set(level.player.vars.wm_collected_from_rajit, 1),
														gold(level,5),
														sound('coin.ogg'),
									)
						)
					]
							)",
		on_talk_ask: "speech_dialog(
							level.player,		[~1: Yes. What's up?\n2: Woodenhead? What's that?~,
													~Opt. 1~,	[fire_event(self, 'talk_pitch')],
													~Opt. 2~,	[fire_event(self, 'talk_whats_that')],
													~Cancel~,	[fire_event(self, 'talk_cancel_0')],
													#~Test~,		[fire_event(self, 'talk_pitch_ask')],#
												],
							)",
		on_talk_cancel_0: "speech_dialog(
							level.player,		set(level.player.animation, 'emote_raisedfinger'),
												[~It's a secret!~],
							)",
		on_talk_cancel_1: "speech_dialog(
							level.player,		set(level.player.animation, 'emote_talk'),
												[~I'm afraid I'm not going that way.~],
							self,				[~Sorry to have bothered you, then.\nHave a nice day.~],
							)",
		on_talk_hover_pads: "speech_dialog(
							self,				[~Those are hoverpads. We use them\nfor temporary stairs and small elevators.~],
							level.player,		set(level.player.animation, 'emote_confused'),
												[~Why not just use one of those to\ntake the medium rope up?~],
							self,				[~Tried it. They only get about 60\nfeet off the ground before they\nrun out of steam.~],
							level.player,		set(level.player.animation, 'emote_talk'),
												[~Oh, too bad.~],
							self,				[~So, will you take the rope up?~],
												fire_event(self, 'talk_more_1'),
							)",
		on_talk_more_1: "speech_dialog(
							level.player,		[~3: What's your name?\n4: What are those grey things?~,
													~Opt. 3~,	[fire_event(self, 'talk_name')],
													~Opt. 4~,	[fire_event(self, 'talk_hover_pads')],
													~Less~,	[fire_event(self, 'talk_pitch_ask')],
													~Cancel~,	[fire_event(self, 'talk_cancel_1')],
												],
							)",
		on_talk_name: "speech_dialog(
							self,				[~I am Rajit. And you?~],
							level.player,		set(level.player.animation, 'emote_talk'),
												[~I am Frogatto, myself.~],
							self,				[~So, Frogatto, will you take this\nrope up to Woodenhead?~],
												fire_event(self, 'talk_more_1'),
							)",
		on_talk_ok: "speech_dialog(
							self,				[~Great! Here is the rope.\n*Rajit hands you the rope.*~],
												set(level.player.vars.wm_has_rope, 1),
							level.player,		set(level.player.animation, 'emote_talk'),
												[~I'll have this up there soon.~],
							self,				[~Thanks.~]
							)",
		on_talk_pay: "speech_dialog(
							self,				[~Sir! I am but a humble working\nman! How am I supposed to pay you?~],
							level.player,		set(level.player.animation, 'emote_talk'),
												[~I notice a distinct absence of\ncoins around here...~],
							self,				[~Eh... I suppose I can let you\nhave 5 coins for the service.\nThere weren't many around.~],
							level.player,		set(level.player.animation, 'emote_raisedfinger'),
												[~Done!~],
												fire_event(self, 'talk_ok'),
							)",
		on_talk_pitch: "speech_dialog(
							self,				[~I'm *trying* to fix the elevator.\nThe cable got tangled with a tree\nduring the storm, and it had to be~],
							level.player,		set(level.player.animation, 'emote_nod'),
							self,				[~cut loose. The idea was that I'd\nfly up with a small, light rope,\nthen I'd attach that to a heavier\nrope and they'd pull that one up,\nand then the heavier rope could be\nused to pull the steel elevator\ncable up.~],
							level.player,		set(level.player.animation, 'emote_talk'),
												[~So? What's holding you up?~],
												set(level.player.animation, 'emote_raisedfinger'),
												[~Or, in this case...\nholding you down?~],
							self,				[~That's not funny.\nAnyhow, I can get the light rope\nup just fine. It's just that...\nwell... I didn't pack a light\nenough medium rope.~],
							level.player,		set(level.player.animation, 'emote_confused'),
												[~You've lost me. Again..?~],
							self,				[~In short, the light rope isn't\nstrong enough to lift the medium\nrope. Someone will have to walk\nthe medium rope up there.~],
											[~I've checked out the path ahead,\nbut	I can't get through it.~],
							level.player,		set(level.player.animation, 'emote_talk'),
												[~So, for the good of the town,\nyou want me to take up the medium\nrope?~],
							self,				[~You know it. If you tell the\nguard there I sent you, he'll\nlet you through.~],
												fire_event(self, 'talk_pitch_ask'),
							)",
		on_talk_pitch_ask: "speech_dialog(
							level.player,		[~1: Sure, I'm on it!\n2: Pay me.~,
